import { useState } from "react";

const Table = (props) => {
  const [finalData, setFinalData] = useState(<tr></tr>);
  if(props.data.lengh > 0) {
    for (let i = 0; i < 3; i++) {
        setFinalData(
          <tr>
            <td>{i + 1}</td>
            <td>{props.data.etnteredFormData[i].savingsEndOfYear}</td>
            <td>{props.data.etnteredFormData[i].yearlyInterest}</td>
            <td>{props.data.etnteredFormData[i].yearlyContribution}</td>
            <td>{props.data.etnteredFormData[i].savingsEndOfYear}</td>
          </tr>
        );
      }
      console.log(props.data.length);
  }
  
  return (
    <table className="result">
      <thead>
        <tr>
          <th>Year</th>
          <th>Total Savings</th>
          <th>Interest (Year)</th>
          <th>Total Interest</th>
          <th>Invested Capital</th>
        </tr>
      </thead>
      <tbody>{finalData}</tbody>
    </table>
  );
};

export default Table;
